CREATE TABLE `opr_codigo_producto` (
  `id_codigo_producto` int(11) NOT NULL AUTO_INCREMENT COMMENT 'indice del producto (autoincrementable)',
  `fecha` datetime DEFAULT NULL COMMENT 'fecha de ingreso del producto',
  `codigo_producto` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT 'codigo de venta del producto',
  `descripcion` varchar(75) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT 'descripci√≥n o detalle del producto',
  `codigo_fabricante` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'codido del fabricante o proveedor',
  `id_tipo_producto` int(11) NOT NULL COMMENT 'tipo de producto',
  `id_producto` int(11) NOT NULL COMMENT 'id adicional de producto',
  `id_marca` int(11) NOT NULL COMMENT 'identificador de la marca',
  `id_modelo` int(11) NOT NULL COMMENT 'idetificador del modelo',
  `talla` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT 'en caso de requerirlo, se describe la talla del producto',
  `existencia` int(11) DEFAULT '0' COMMENT 'existencia actual',
  `precio` decimal(12,2) DEFAULT '0.00' COMMENT 'precio o costo del producto',
  `id_operador` int(11) unsigned NOT NULL COMMENT 'identificador del operador que registra el producto',
  `estado_registro` enum('A','B') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL DEFAULT 'A' COMMENT 'El estado del registro, A-Alta y B-Baja',
  PRIMARY KEY (`id_codigo_producto`),
  UNIQUE KEY `empresa_codigo_producto_ix` (`codigo_producto`),
  KEY `ix_codigo_producto` (`codigo_producto`),
  KEY `id_tipo_producto_idx` (`id_tipo_producto`),
  KEY `id_marca_idx` (`id_marca`),
  KEY `id_modelo_idx` (`id_modelo`),
  CONSTRAINT `id_marca` FOREIGN KEY (`id_marca`) REFERENCES `opr_marca` (`id_marca_producto`),
  CONSTRAINT `id_modelo` FOREIGN KEY (`id_modelo`) REFERENCES `opr_modelo` (`id_modelo`),
  CONSTRAINT `id_tipo_producto` FOREIGN KEY (`id_tipo_producto`) REFERENCES `opr_tipo_producto` (`id_tipo_producto`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
